import React, { Component } from "react";

class CartPage extends Component {
  render() {
    console.log(sessionStorage.getItem("cartItems"));
    let list = [];
    const splitted = sessionStorage.getItem("cartItems").split("|");
    for (const object of splitted) {
      list.push(
        JSON.parse(
          '{"' +
            decodeURI(object)
              .replace(/"/g, '\\"')
              .replace(/&/g, '","')
              .replace(/=/g, '":"') +
            '"}'
        )
      );
    }
    console.log(list);
    return <h1>Cart Page</h1>;
  }
}

export default CartPage;
